/** @format */

import React from "react";
import "../App.css";

export const DrawerMenu = ({
  Type = "",
  title = "Dashboard",
  onClick = () => console.log("onclicked"),
}) => (
  <div onClick={onClick} className="drawer">
    <Type style={{ color: "#fff" }} className="drawer-icon" />
    <span class="drawer-menu-title">{title}</span>
  </div>
);
